import React from "react";

const Contact = () => {
  return (
    <section id="contact" className="section">
      <h2>Contact</h2>
      <p>
        Email:{" "}
        <a href="mailto:adhamhaithameid@gmail.com">adhamhaithameid@gmail.com</a>
      </p>
      <p>
        LinkedIn:{" "}
        <a
          href="https://www.linkedin.com/in/adhamhaithameid/"
          target="_blank"
          rel="noopener noreferrer"
        >
          adhamhaithameid
        </a>
      </p>
      <p>
        GitHub:{" "}
        <a
          href="https://github.com/adhamhaithameid"
          target="_blank"
          rel="noopener noreferrer"
        >
          adhamhaithameid
        </a>
      </p>
    </section>
  );
};

export default Contact;
